			["text1Enabled"] = false,
			["customTriggerLogic"] = "function(t)\n    local reg = WeakAuras.regions[aura_env.id].region\n    local gs = select(4, GetTalentInfo(6,1,1))\n    \n    -- [1]- Frost Strike usable, [2]- RW Glowing?,\n    -- [3]- Hblast Glowing? [4]- Oblit Glowing?\n    -- [5]- RP >= 80 [6]- BoS Active\n    -- [7]- BoS CD >= 15sec [8]- BoS >5sec cd, [9]BoS glowing?\n    -- [10]- GCD, [11]- BoS <= 5sec remaining\n    \n    if t[6] or t[11] then --be certain no Frost Strike during BoS or off cd\n        WeakAuras.ScanEvents(\"FROST_STRIKE_GLOWS\",false)\n        return false\n    end\n    if ( gs and t[1] and t[3] and t[4] and t[5] and t[9] )\n    or ( gs and t[1] and t[3] and t[4] and t[7] and t[9] )\n    then\n        --if Gathering Storm...\n        ActionButton_ShowOverlayGlow(reg)\n        WeakAuras.ScanEvents(\"FROST_STRIKE_GLOWS\",true)\n        return true\n    elseif ( not gs and t[1] and t[3] and t[5] and t[8] and t[9] )\n    or ( not gs and t[1] and t[3] and t[4] and t[7] and t[9] )\n    then\n        --if not Gathering Storm...\n        ActionButton_ShowOverlayGlow(reg)\n        WeakAuras.ScanEvents(\"FROST_STRIKE_GLOWS\",true)\n        return true\n    elseif ( t[4] and not t[5] ) then\n        ActionButton_HideOverlayGlow(reg)\n        WeakAuras.ScanEvents(\"FROST_STRIKE_GLOWS\",false)\n        return false\n    end\n    ActionButton_HideOverlayGlow(reg)\n    WeakAuras.ScanEvents(\"FROST_STRIKE_GLOWS\",false)\nend",
