			},
			["untrigger"] = {
				["custom"] = "function()\n    \n    local startTime, duration = 0, 0\n    --Funtion only triggers when someone dies or resurrects (because of PLAYER_DEAD/ALIVE event)\n    local _, englishClass = UnitClass(\"player\") -- gets the players class\n    if englishClass == \"DRUID\" then\n        startTime, duration = GetSpellCooldown(20484) -- get rebirth cooldown\n    elseif englishClass == \"WARLOCK\" then\n        startTime, duration = GetSpellCooldown(20707) -- get soulstone cooldown\n    elseif englishClass == \"DEATHKNIGHT\" then\n        startTime, duration = GetSpellCooldown(61999) -- get raise ally cooldown\n    end\n    \n    if (startTime > 0 and duration > 0) then -- do nothing if the spell is on cooldown.\n        return true\n    else\n        \n        \n        return #WA_someoneIsDead_deadPlayerTable == 0 \n        -- If there are 0 players in the table, return true\n        -- this is the same variable as in Custom Trigger\n    end\n    \n    \nend\n\n\n\n",
			},
			["anchorPoint"] = "CENTER",
			["activeTriggerMode"] = 0,
			["customTextUpdate"] = "update",
			["icon"] = true,
			["text1Enabled"] = true,
			["keepAspectRatio"] = false,
			["animation"] = {
				["start"] = {
					["type"] = "custom",
					["colorR"] = 1,
					["scalex"] = 1,
					["duration_type"] = "seconds",
					["translateFunc"] = "    function(progress, startX, startY, deltaX, deltaY)\n      local bounceDistance = math.sin(progress * math.pi)\n      return startX + (bounceDistance * deltaX), startY + (bounceDistance * deltaY)\n    end\n  ",
					["duration"] = ".3",
					["alpha"] = 0,
					["colorB"] = 1,
					["y"] = 5,
					["colorA"] = 1,
					["colorG"] = 1,
					["x"] = 0,
					["scaley"] = 1,
					["rotate"] = 0,
					["use_translate"] = true,
					["translateType"] = "bounce",
				},
				["main"] = {
					["type"] = "custom",
					["colorR"] = 1,
					["duration"] = ".75",
					["duration_type"] = "seconds",
					["translateFunc"] = "    function(progress, startX, startY, deltaX, deltaY)\n      local prog\n      if(progress < 0.25) then\n        prog = progress * 4\n      elseif(progress < .75) then\n        prog = 2 - (progress * 4)\n      else\n        prog = (progress - 1) * 4\n      end\n      return startX + (prog * deltaX), startY + (prog * deltaY)\n    end\n  ",
					["scalex"] = 1,
					["alpha"] = 0,
					["colorB"] = 1,
					["y"] = 0,
					["colorA"] = 1,
					["colorG"] = 1,
					["x"] = 5,
					["scaley"] = 1,
					["rotate"] = 0,
					["use_translate"] = true,
					["translateType"] = "shake",
				},
				["finish"] = {
					["duration_type"] = "seconds",
					["type"] = "none",
				},
			},
			["trigger"] = {
				["debuffType"] = "HELPFUL",
				["type"] = "custom",
				["custom_type"] = "status",
				["subeventSuffix"] = "_CAST_START",
				["names"] = {
				},
				["custom"] = "function()\n    \n    local startTime, duration = 0, 0\n    WA_someoneIsDead_deadPlayerTable = {} -- Gobal Variable that stores all the dead players\n    \n    local _, englishClass = UnitClass(\"player\") -- gets the players class\n    if englishClass == \"DRUID\" then\n        startTime, duration = GetSpellCooldown(20484) -- get rebirth cooldown\n    elseif englishClass == \"WARLOCK\" then\n        startTime, duration = GetSpellCooldown(20707) -- get soulstone cooldown\n    elseif englishClass == \"DEATHKNIGHT\" then\n        startTime, duration = GetSpellCooldown(61999) -- get raise ally cooldown\n    else \n        return false -- if none of these classes, it shouldnt do anything (though this wont load any way with load parameters)\n    end\n    \n    \n    --//Start figuring out if we should trigger//\n    if (startTime > 0 and duration > 0) then -- do nothing if the spell is on cooldown.\n        return false\n    else\n        local deadPlayers = WA_someoneIsDead_deadPlayerTable  \n        --Trying to follow what another piece of code does. Not sure why this is used.\n        \n        local myZone = GetZoneText() -- Saves the zone I am currently in.\n        \n        for index =1, GetNumGroupMembers() do -- This cycles through every raid member\n            local name, _, _, _, _, _, zone, online, isDead,_,_,combatRole = GetRaidRosterInfo(index) \n            -- Saves info for each player we are cycling through.\n            \n            if online and isDead and  (combatRole == \"HEALER\" or combatRole == \"TANK\") and  zone == myZone then\n                -- This if statement triggers if the player is online, dead, is a healer or tank, and is in the same zone as me.\n                table.insert(deadPlayers, name) -- inserts  the players name into the table.\n            end\n            \n        end\n        \n        return deadPlayers[1] ~= nil -- returns true if there is someone in the list.\n        \n        \n        \n        \n    end\n    \n    \n    \n    \nend",
				["genericShowOn"] = "showOnActive",
				["subeventPrefix"] = "SPELL",
				["spellIds"] = {
				},
				["customName"] = "function()\n    \n    local deadPlayers = WA_someoneIsDead_deadPlayerTable -- save global table locally\n    local maxPlayersIndividuallyShown = 3 --if there are more than 4 players dead, show the number of players\n    local returnString = \"\" -- start with an empty string.\n    \n    if #deadPlayers > maxPlayersIndividuallyShown then -- if the number of dead players is greater than 3, show the number\n        returnString = #deadPlayers .. \" players\"\n    else\n        for i = 1, #deadPlayers do -- else, return names of every player seperated by a new line.\n            returnString = returnString..(deadPlayers[i])..\"\\n\"\n        end\n    end\n    \n    return returnString\n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
