			["customTriggerLogic"] = "function(t)\n    local reg = WeakAuras.regions[aura_env.id].region\n    local glacial_advance = select(4, GetTalentInfo(6,2,1))\n    local gs = select(4, GetTalentInfo(6,1,1))\n    \n    -- [1]- Oblit usable, [2]- Will not cap runic power,\n    -- [3]- Hblast Glowing? [4]- Frost Strike Glowing?\n    -- [5]- Glacial Advance CD, [6] Killing Machine\n    -- [7]- BoS Active [8]- Remorseless Winter on cd [9]- BoS Glowing?\n    -- [10]- <=4 runes [11]- BoS CD <=15sec [12]- RP < 70 [13]- GCD\n    \n    if (t[1] and t[3] and t[10] and not t[7] and t[9])\n    then\n        ActionButton_ShowOverlayGlow(reg)\n        WeakAuras.ScanEvents(\"oblit_glows\",true)\n        return true\n        \n    elseif ( t[1] and t[2] and t[3] and t[4] and not t[7] and gs  \n        and t[8] and t[9] and not t[11] ) \n    then\n        ActionButton_ShowOverlayGlow(reg)\n        WeakAuras.ScanEvents(\"oblit_glows\",true)\n        return true\n        \n    elseif ( t[1] and t[2] and t[3] and not t[7] \n        and t[11] and t[12] ) \n    then -- Use oblit to get 70 RP for BoS\n        ActionButton_ShowOverlayGlow(reg)\n        WeakAuras.ScanEvents(\"oblit_glows\",true)\n        return true\n        \n    elseif ( t[1] and t[2] and t[3] and t[7] ) \n    then  --If BoS is active...\n        ActionButton_ShowOverlayGlow(reg)\n        WeakAuras.ScanEvents(\"oblit_glows\",true)\n        return true\n    end\n    ActionButton_HideOverlayGlow(reg)\n    WeakAuras.ScanEvents(\"oblit_glows\",false)\nend",
